import React from 'react';
import LoginForm from './LoginForm';
import RegistrationForm from './RegistrationForm';

import Watchlist from './Watchlist';

const App: React.FC = () => {
  return (
    <div>
      <LoginForm />
      <RegistrationForm />
      <Watchlist />
    </div>
  );
};

export default App;
